"""
    438.Find All Anagrams in a String 2018-8-14 20:47:37
    Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.

    Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20,100.

    The order of output does not matter.

    Example 1:

    Input:
    s: "cbaebabacd" p: "abc"

    Output:
    [0, 6]

    Explanation:
    The substring with start index = 0 is "cba", which is an anagram of "abc".
    The substring with start index = 6 is "bac", which is an anagram of "abc".
    Example 2:

    Input:
    s: "abab" p: "ab"

    Output:
    [0, 1, 2]

    Explanation:
    The substring with start index = 0 is "ab", which is an anagram of "ab".
    The substring with start index = 1 is "ba", which is an anagram of "ab".
    The substring with start index = 2 is "ab", which is an anagram of "ab".
"""


class find_all_anagrams_in_a_string:
    def findAnagrams(self, s, p):
        """
        :type s:string
        :type p:String
        :rtype:List[int]
        """
        anagramlist = []

        indexOfChar = 0
        dstLength = len(p)

        while indexOfChar < len(s) and indexOfChar + dstLength <= len(s):
            subStr = s[indexOfChar:indexOfChar + dstLength]

            setOfSubStr = "".join(str(x) for x in set(subStr))
            setOfP = "".join(str(x) for x in set(p))
            if len(setOfSubStr) != len(setOfP):
                indexOfChar +=1
                continue

            if self.isAnagram(setOfSubStr, setOfP):
                anagramlist.append(indexOfChar)

            indexOfChar += 1

        return anagramlist

    def isAnagram(self, strOrigin, strDst):

        while len(strOrigin) > 0:

            while len(strDst) > 0:
                if strOrigin.find(strDst[0]) == -1:  # index 如果char 没在string中 会raise error
                    return False

                strOrigin = strOrigin.replace(strDst[0], "", 1)
                strDst = strDst.replace(strDst[0], "", 1)

        return True

    def distinctStr(self, str):
        dis = list()
        for i in str:
            if i in dis:
                continue
            dis.append(i)

        return "".join(x for x in dis)          #list to string in python


s = "baxxsaa"
p = "a"

s = ""
p = ""

s="ababababab"
p="aab"
instance = find_all_anagrams_in_a_string()
print(instance.findAnagrams(s, p))
